style.css:
@-moz-document domain("www.centrelink.gov.au") {
body,
.landing-right .favs,
.dhs-table-accordion-panel>td,
.questions-wrapper .q-container:nth-child(even),
.modal-content,
.info-message,
select, textarea,
.slide-list .inner ul,
#container, #cs1
{
    background-color: #333;
}

thead,
.footer,
.breadcrumb-container,
.dls-upload-btn,
.btn-thnav,
.form-control,
.form-control:active,
.slide-list, .slide-list ul.acc li a.acc-static, .slide-list ul.acc li a.acc-toggle, .slide-list .sticky-div,
.shaded-box,
.allservices .subhead
{
    background: #222 !important;
}

.common-redesign-table tr,
table.common-redesign-table thead>tr>th,
.table-striped>tbody>tr:nth-child(odd)>td, .table-striped>tbody>tr:nth-child(odd)>th
{
    background: inherit;
}

tbody,
.dhs-card,
.card, .card-repay,
.lp-body-messages .lp-body-no-messages,
.list-group-item,
.q-container,
.dhs-table>*>tr.dhs-accordion-title--horizontal>td, .dhs-table>*>tr.dhs-accordion-title--horizontal>th,
.slide-list ul.acc li a.acc-static:hover, .slide-list ul.acc li a.acc-toggle:hover,
.allservices .acc-toggle,
.floating-help, .floating-print, .go-top-navigation a
{
    background-color: #444 !important;    
}

ol.breadcrumb,
.blue-gradient,
.slide-list ul.acc .inner a,
.slide-list .close-button,
.slide-list .return-home,
.fixed-page-heading {
    background: none;
}

body, p,
.dhs-page-alert,
thead tr,
.common-redesign-table tr,
.rd-help-link,
.meganav-wrapper .mega-menu .list-cat,
.breadcrumb a,
.breadcrumb li.current,
.landing-body,
.sub-menu .list-cat,
.qText, .qHelpText,
.landing-right ul.header-fav-list li.list-group-item a,
.h1, .h2, .h3, .h4, .h5, .h6, h1, h2, h3, h4, h5, h6,
#cs1 h2, #cs3 h2, #cs7 h2, #cs8 h2, #cs10 h2 {
    color: #ccc !important;
}

.slide-list ul.acc li ul li a.acc-toggle,
.slide-list ul.acc li ul li a.acc-toggle:focus, .slide-list ul.acc li ul li a.acc-toggle:hover {
    color: #777 !important;
}

a,
.allservices .expnd, .allservices .clps 
{
    color: #75bcff
}

.sub-menu .list-cat,
.blue-gradient,
select, textarea,
.floating-help, .floating-print,
.modal-header,
.allservices .f,
.allservices .subhead,
.allservices .expnd, .allservices .clps,
.meganav-wrapper .mega-menu .list-cat,
.slide-list ul.acc li a.acc-toggle,
.slide-list ul.acc li a.acc-static, .slide-list ul.acc li:last-of-type, .slide-list ul.acc li:last-child,
.dhs-table>*>tr.dhs-accordion-title--horizontal>td, .dhs-table>*>tr.dhs-accordion-title--horizontal>th {
    border: none !important;
}

a,
.slide-list ul.acc .inner a,
ol.breadcrumb li a{
    text-decoration: none;
}
}
